import { Box, Modal, TextField } from "@mui/material";

const QuizModal = ({ open, quiz, onClose }) => {
  const handleClose = () => {};

  const style = {
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    width: 400,
    bgcolor: "background.paper",
    border: "2px solid #000",
    boxShadow: 24,
    p: 4,
    borderRadius: 4,
  };

  return (
    <Box className>
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
          <h4>Add Quiz</h4>
          <TextField
            required
            id="outlined-required"
            label="Title"
            defaultValue=""
          />
        </Box>
      </Modal>
    </Box>
  );
};
export default QuizModal;
